ds and reps accumulated in 15:00","For Time: &lt;br&gt;60 Clean and Jerks (60/42.5kg)&lt;br&gt;1 Mile Run (Run together)&lt;br&gt;50 Strict Pull-Ups&lt;br&gt;1 Mile Run (Run together)&lt;br&gt;100 Synchro Burpees&lt;br&gt;&lt;br&gt;* Athletes can break up the Clean &amp; Jerk and Rope Climbs (or Strict Pull-Up) reps however they wish in a \"you go, I go\" format. &lt;br&gt;* The Runs and Burpees are to be completed together","Every :90 for 5 sets:&lt;br&gt;2 Clean Pulls + 1 Squat Clean","10 Rounds For Time:&lt;br&gt;5 Squat Cleans &lt;br&gt;10/7 Calorie Row&lt;br&gt;&lt;br&gt;*Score = Time it takes to complete the workout","Every 3 Minutes x 10 Rounds:&lt;br&gt;[On the 0:00]: 500/450 Meter Row&lt;br&gt;[On the 3:00]:400 Meter Run&lt;br&gt;&lt;br&gt;[On the 6:00]: 500/450 Meter Row&lt;br&gt;[On the 9:00]: 400 Meter Run&lt;br&gt;&lt;br&gt;[On the 12:00]: 500/450 Meter Row&lt;br&gt;[On the 15:00]: 400 Meter Run&lt;br&gt;&lt;br&gt;[On the 18:00]: 500/450 Meter Row&lt;br&gt;[On the 21:00]: 400 Meter Run&lt;br&gt;&lt;br&gt;[On the 24:00]: 500/450 Meter Row&lt;br&gt;[On the 27:00]: 400 Meter Run&lt;br&gt;&lt;br&gt;* Score = Sum total of all 10 rounds","Every :90 for 4 sets:&lt;br&gt;1 Power Snatch + 3 Overhead Squats w/ :5 pause in the bottom","5 Rounds For Time:&lt;br&gt;15 Overhead Squats &lt;br&gt;12 Chest to Bar Pull-ups&lt;br&gt;9 Burpee Box Jumps &lt;br&gt;&lt;br&gt;* Score = The total time is takes to complete the workout","Snatch&lt;br&gt;&lt;br&gt;EMOM 10&lt;br&gt;x1 Snatch every minute on the minute.&lt;br&gt;&lt;br&gt;- Build in load across sets to finish on a heavy single for the day.&lt;br&gt;- Score is heaviest load lifted.","Back Squat&lt;br&gt;&lt;br&gt;Build to a heavy 3reps for the day.&lt;br&gt;&lt;br&gt;- Score is heaviest load lifted.","For Time:&lt;br&gt;30/24 Calorie Row&lt;br&gt;100 Double Unders&lt;br&gt;30 Kipping Handstand Push-ups &lt;br&gt;100 Double Unders&lt;br&gt;30/24 Calorie Row&lt;br&gt;&lt;br&gt;*On the Minute: 6 Alternating Dumbbell Power Snatches (50/35)","10 Rounds of Cindy (Partners switching after full rounds)&lt;br&gt;40 Clusters (One partner working at a time)&lt;br&gt;Rest 1:00&lt;br&gt;Run 1 Mile (Together)&lt;br&gt;&lt;br&gt;* Score = Time it takes to complete the workout&lt;br&gt;* Include the 1:00 rest in the total score&lt;br&gt;* 1 Round of \"Cindy\" - 5 Pull-Ups/10 Push-Ups/15 Air Squats","AMRAP 20:&lt;br&gt;40 Wallballs &lt;br&gt;30/24 Calorie Row&lt;br&gt;20 Toes to Bar&lt;br&gt;10 Alternating Dumbbell Power Snatches &lt;br&gt;&lt;br&gt;*Score = number of rounds and reps accumulated in 20:00","For Time:&lt;br&gt;21 Deadlifts&lt;br&gt;200 Meter Run&lt;br&gt;21 Lateral Barbell Burpees&lt;br&gt;200 Meter Run&lt;br&gt;15 Deadlifts&lt;br&gt;200 Meter Run&lt;br&gt;15 Lateral Barbell Burpees&lt;br&gt;200 Meter Run&lt;br&gt;9 Deadlifts&lt;br&gt;200 Meter Run&lt;br&gt;9 Lateral Barbell Burpees&lt;br&gt;200 Meter Run&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;* Score = Time taken to complete the workout","On the 4:00 x 5 Rounds:&lt;br&gt;15/12 Calorie row&lt;br&gt;12 Chest to Bar Pull-ups&lt;br&gt;9 Thrusters&lt;br&gt;&lt;br&gt;*Score = Slowest Round. Log all four round times.","[PART 1 - 0:00-10:00]&lt;br&gt;\"HEAVY DAY\"&lt;br&gt;FOR LOAD:&lt;br&gt;12-8-6-4-2&lt;br&gt;*Increase the load across all sets&lt;br&gt;*Score = Log loads for each round","[PART 2]&lt;br&gt;For Time:&lt;br&gt;40-30-20&lt;br&gt;Abmat Sit-ups&lt;br&gt;Russian Kettlebell Swings (70/53)&lt;br&gt;Directly into...&lt;br&gt;30-20-10&lt;br&gt;GHD Sit-ups (or Medball Overhead Sit-Ups)&lt;br&gt;Back Extensions (or Barbell Good Mornings)","3 position clean&lt;br&gt;Perform one 3 position clean every 90secs for 8 rounds.&lt;br&gt;&lt;br&gt;*3 position clean= &lt;br&gt;1x high hang clean&lt;br&gt;1x hang clean&lt;br&gt;1x clean &lt;br&gt;&lt;br&gt;*Score is heaviest set complete.","Front squat with pause.&lt;br&gt;&lt;br&gt;5x5 reps @50% with a 2 second pause at the bottom of each rep.","3 Rounds For Time:&lt;br&gt;400 Meter Run&lt;br&gt;10 Power Cleans &lt;br&gt;500/450 Meter Row&lt;br&gt;10 Push Jerks &lt;br&gt;&lt;br&gt;* Score = Time taken to complete the workout","6 Rounds:&lt;br&gt;1 Minute Row for calories&lt;br&gt;1 Minute Synchro Burpees Over the Rower&lt;br&gt;1 Minute Double Unders&lt;br&gt;1 Minute Rest&lt;br&gt;&lt;br&gt;P1: ROW- BURPEE- DU&lt;br&gt;P2: DU- BURPEE- ROW&lt;br&gt;* when on the burpee station partners perform synchronised burpees. &lt;br&gt;*Score = Total reps completed. Log reps for all six rounds.","PART 1: HEAVY DOUBLE POWER SNATCH [12:00]&lt;br&gt;Power Snatch&lt;br&gt;2-2-2-2-2&lt;br&gt;&lt;br&gt;*Increase loads across each set&lt;br&gt;*If newer, increase reps to 5 at light loads&lt;br&gt;*Touch &amp; Go&lt;br&gt;*Score = Log all 5 lifts. Failed attempts count.","[PART 1]&lt;br&gt;AMRAP 10: &lt;br&gt;4 Rounds:&lt;br&gt;30 Air Squats&lt;br&gt;200 Meter Run&lt;br&gt;&lt;br&gt;In Time Remaining:&lt;br&gt;Max Power Snatches &lt;br&gt;&lt;br&gt;* Score = Number of power snatches completed at 10:00","For Time:&lt;br&gt;3 Rounds:&lt;br&gt;15 Deadlifts&lt;br&gt;10 Push Press&lt;br&gt;5 Bar Muscle-ups&lt;br&gt;&lt;br&gt;Directly Into...&lt;br&gt;&lt;br&gt;1500m Row&lt;br&gt;&lt;br&gt;Directly Into...&lt;br&gt;&lt;br&gt;3 Rounds:&lt;br&gt;15 Deadlifts&lt;br&gt;10 Push Press&lt;br&gt;5 Bar Muscle-ups&lt;br&gt;&lt;br&gt;Score = Time it takes to complete the workout","AMRAP 5: &lt;br&gt;Buy-In: 400 Meter Run &lt;br&gt;Max Rounds With Time Remaining: &lt;br&gt;12 Front Squats (115/85)&lt;br&gt;6 Burpee Box Jump Overs &lt;br&gt;&lt;br&gt;[Rest 5 Minutes ]&lt;br&gt;&lt;br&gt;AMRAP 5: &lt;br&gt;Buy-In: 400 Meter Run &lt;br&gt;Max Rounds With Time Remaining: &lt;br&gt;9 Front Squats (135/95)&lt;br&gt;6 Burpee Box Jump Overs &lt;br&gt;&lt;br&gt;[Rest 5 Minutes ]&lt;br&gt;&lt;br&gt;AMRAP 5: &lt;br&gt;Buy-In: 400 Meter Run &lt;br&gt;Max Rounds With Time Remaining:&lt;br&gt;6 Front Squats (155/105)&lt;br&gt;6 Burpee Box Jump Overs &lt;br&gt;&lt;br&gt;*Score = Rounds and reps accumulated. The Run is only a Buy-In.","Power clean+ split jerk&lt;br&gt;1+2 reps every 2 minutes for 8 rounds.&lt;br&gt;&lt;br&gt;*2 second pause in the dip and catch of each split jerk.&lt;br&gt;* Score is heaviest lift completed.","Front squat with pause&lt;br&gt;5x5 reps &lt;br&gt;&lt;br&gt;*Looking for a 2.5/5kg increase on last week.&lt;br&gt;* 2 second pause in the bottom of each rep.","AMRAP 18:&lt;br&gt;30 Single Dumbbell Alternating Power Snatches &lt;br&gt;30/24 Calorie row&lt;br&gt;30 Toes to Bar &lt;br&gt;30 Single Dumbbell Box Step-ups &lt;br&gt;&lt;br&gt;*Score = The number of rounds and reps completed in 18:00","For Time:&lt;br&gt;*200m run.&lt;br&gt;&lt;br&gt;15 Squat Cleans&lt;br&gt;12 Squat Cleans&lt;br&gt;9 Squat Cleans&lt;br&gt;6 Squat Cleans&lt;br&gt;6 Push Jerks&lt;br&gt;9 Push Jerks&lt;br&gt;12 Push Jerks&lt;br&gt;15 Push Jerks&lt;br&gt;&lt;br&gt;&lt;br&gt;Teams of 2:&lt;br&gt;P1: Starts on the barbell, completes 15 Squat Cleans&lt;br&gt;P2: Runs 200m&lt;br&gt;When P2 returns from the run, and P1 has finished all reps, partners then switch stations.&lt;br&gt;P1 Runs while P2 is on the barbell and so on.&lt;br&gt;&lt;br&gt;*Score = Time it takes to complete the workout","[PART 1]&lt;br&gt;For Time:&lt;br&gt;21-15-9:&lt;br&gt;Squat Snatches &lt;br&gt;Chest to Bar Pull-ups&lt;br&gt;&lt;br&gt;* 10 minute cap&lt;br&gt;* Score = The time it takes to complete the workout","SNATCH COMPLEX (For Load &amp; Quality)&lt;br&gt;From 10:00-18:00:&lt;br&gt;In the remaining time:&lt;br&gt;1 Snatch Grip Deadlift + 1 Squat Snatch + 1 Overhead Squat&lt;br&gt;&lt;br&gt;Score = heaviest load lifted","On the 10:00 x 3 Rounds:&lt;br&gt;30/24 Calorie Row&lt;br&gt;200 Meter Run&lt;br&gt;30/24 Calorie Row&lt;br&gt;200 Meter Run&lt;br&gt;&lt;br&gt;* Score = Log the time for all 3 rounds. The score is the sum total of all three rounds.","AMRAP 13: &lt;br&gt;10 Lateral Barbell Burpees&lt;br&gt;1 Round of \"Macho Man\"&lt;br&gt;10 Lateral Barbell Burpees&lt;br&gt;2 Rounds of \"Macho Man\"&lt;br&gt;10 Lateral Barbell Burpees&lt;br&gt;3 Rounds of \"Macho Man\"&lt;br&gt;10 Lateral Barbell Burpees&lt;br&gt;4 Rounds of \"Macho Man\"&lt;br&gt;10 Lateral Barbell Burpees&lt;br&gt;5 Rounds of \"Macho Man\"&lt;br&gt;&lt;br&gt;Continue Adding 1 Round of \u2018Macho Man\u201d after each set of 10 Lateral Bar Burpees until 13:00 expires&lt;br&gt;1 Round of \u201cMacho Man\u201d = 3 Power Cleans + 3 Front Squats + 3 Push Jerks&lt;br&gt;&lt;br&gt;&lt;br&gt;&lt;br&gt;* Score = The number of rounds + reps completed in 13:00&lt;br&gt;Eg. An athlete completes the 3 rounds of \"Macho Man\" and 6 Lateral Barbell Burpees, the score would be 3 Rounds + 6 Reps.","Clean+ Hang clean+ Jerk&lt;br&gt;&lt;br&gt;1+1+1 every 2 minutes for 6 rounds.&lt;br&gt;&lt;br&gt;* Score is heaviest load lifted.&lt;br&gt;* Pause of 2 seconds in the catch of the jerk.","5x 3 reps @5kg heavier than previous week.&lt;br&gt;&lt;br&gt;*2 second pause in the bottom of each rep.","4 Rounds For Time:&lt;br&gt;500 Meter Row&lt;br&gt;9 Deadlifts &lt;br&gt;18 Kipping Handstand Push-Ups&lt;br&gt;&lt;br&gt;Score = The time it takes to complete the workout","2 Rounds For Time:&lt;br&gt;800 Meter Run (together) &lt;br&gt;100 Wall Balls &lt;br&gt;40 Single Dumbbell Devil Presses &lt;br&gt;&lt;br&gt;* Partition wall balls and devil presses as needed. One partner working at a time.&lt;br&gt;* Score = The time it takes to complete the workout","For Time:&lt;br&gt;1 Mile Run&lt;br&gt;60 Alternating Pistols&lt;br&gt;50 Chest to Bar Pull-ups&lt;br&gt;40 Bar-Facing Burpees&lt;br&gt;30 Power Snatches &lt;br&gt;&lt;br&gt;* Score = Time it takes to complete the workout","Every 2:00 for 10:00:&lt;br&gt;Complete 2 Touch &amp; Go Power Cleans&lt;br&gt;&lt;br&gt;*Increase loads across each set*","[PART 2]&lt;br&gt;AMRAP 10: &lt;br&gt;15/12 Calorie Row&lt;br&gt;3 Power Cleans &lt;br&gt;15/12 Calorie Row&lt;br&gt;6 Power Cleans &lt;br&gt;15/12 Calorie Row&lt;br&gt;9 Power Cleans &lt;br&gt;15/12 Calorie Row&lt;br&gt;12 Power Cleans&lt;br&gt;&lt;br&gt;* Add 3 Power Cleans per round for 10:00&lt;br&gt;* Score = The number of rounds + reps/cals in 10:00","AMRAP 8:&lt;br&gt;Buy-In: 800 Meter Run &lt;br&gt;Time Remaining:&lt;br&gt;30 Double Unders&lt;br&gt;15 Thrusters &lt;br&gt;&lt;br&gt;[Rest 4 Minutes]&lt;br&gt;&lt;br&gt;AMRAP 8:&lt;br&gt;Buy-In: 800 Meter Run &lt;br&gt;Time Remaining:&lt;br&gt;30 Double Unders&lt;br&gt;15 Overhead Squats &lt;br&gt;&lt;br&gt;* Score = Log rounds + reps for both AMRAP'S. Score is sum total.","5 Rounds For Time:&lt;br&gt;100 Meter Double Dumbbell Farmers Carry &lt;br&gt;30 AbMat Sit-ups&lt;br&gt;10 Double dumbbell hang cleans &lt;br&gt;&lt;br&gt;* Score = Time it takes to complete the workout","Clean+ Front squat+ Jerk&lt;br&gt;&lt;br&gt;6x 1+1+1&lt;br&gt;&lt;br&gt;* Rest 2 minutes between sets.","Front squat&lt;br&gt;&lt;br&gt;5x3reps @5kg heavier than previous week.&lt;br&gt;&lt;br&gt;*1 second pause in the bottom of each rep.","AMRAP 20:&lt;br&gt;15 Toes to Bar&lt;br&gt;12/9 Calorie Row&lt;br&gt;9 Hang Power Snatches &lt;br&gt;6 Strict Handstand Push-Ups&lt;br&gt;&lt;br&gt;* Score = The number of rounds + reps in 20:00","[PARTNER WORKOUT]&lt;br&gt;AMRAP 31:00&lt;br&gt;8 Thrusters (155/105)&lt;br&gt;6 Strict pull ups&lt;br&gt;11 Box Jumps (30/24\u2033)&lt;br&gt;&lt;br&gt;*This is a Partner WOD \u2013 Partner #1 will perform the work listed above. Partner #2 will run 400m with a dumbbell. Once Partner #2 returns from the run, Partner #1 will grab the dumbbell and begin their 400m, while Partner #2 continues work wherever #1 left off.&lt;br&gt;&lt;br&gt;* Score = The number of rounds + reps in 31:00","PART 1. ON A 12:00 CLOCK BUILD TO A HEAVY SQUAT CLEAN &lt;br&gt;&lt;br&gt;1 Squat Clean every :90 (8 sets)&lt;br&gt;1-1-1-1-1-1-1-1&lt;br&gt;&lt;br&gt;*The first 3 sets can be treated as warm-ups with the last 5 sets as \u201cwork sets\u201d&lt;br&gt;*Increase the load every round&lt;br&gt;*Score = Log all 8 sets&lt;br&gt;&lt;br&gt;*Sets 1-3 - Warm-U
